import React from 'react';

function Dashboard() {
  return (
    <div style={{ textAlign: 'center', marginTop: '100px' }}>
      <h2>Bienvenido a la plataforma</h2>
      <p>Aquí irán las reservas de canchas, perfil, etc.</p>
    </div>
  );
}

export default Dashboard;
